function fn_api_request(
  controller,
  action,
  params,
  success,
  error,
  try_count = 0,
  retry_limit = 4
) {
  var data = $.extend(
    {
      email_or_login: g_email_or_login,
      switch_login: "1",
      next_step_url: fn_get_redirect_url(),
    },
    params || {}
  );

  fn_ajax({
    type: "POST",
    url: g_server_url + controller + "/" + action,
    dataType: "json",
    data: data,
    tryCount: 0,
    retryLimit: 10,
    async: true,
    success: function (response, t, x) {
      console.log("fn_api_request", response);

      if (response && response["error"]) {
        if (params["ignore_errors"]) {
          return;
        }
        if (response["error"] == "SIGN_UP") {
          if (
            g_ignore_account_list_gmail_auto_followup.indexOf(
              g_email_or_login
            ) == -1
          ) {
            fn_display_misc_dialog(
              '<div style="width: 400px"><center>Checking account ...</center></div>',
              null
            );
            fn_check_login_and_signup_dialog_if_needed();
          } else {
            g_sdk.ButterBar.showMessage({
              text:
                "Important: " +
                g_cloudHQ_extension_name +
                " is disabled because you have not created an account",
              messageKey: "cloudHQ_butter_gmail_campaign",
            });
          }
        } else if (response["error"] == "Please log in.") {
          if (
            g_ignore_account_list_gmail_auto_followup.indexOf(
              g_email_or_login
            ) == -1
          ) {
            g_sdk.ButterBar.showMessage({
              text:
                "Important: " +
                g_cloudHQ_extension_name +
                " is disabled because you are logged out from cloudHQ",
              messageKey: "cloudHQ_butter_gmail_campaign",
            });
          }
        } else {
          if (response["error"] && response["error"]["message"]) {
            fn_display_misc_dialog(
              '<div style="width: 400px"><center>' +
                response["error"]["message"] +
                "</center></div>",
              "ERROR"
            );
          } else if (response["error"] && !response["error"]["message"]) {
            fn_display_misc_dialog(
              '<div style="width: 400px"><center>' +
                response["error"] +
                "</center></div>",
              "ERROR"
            );
          }
          if (error) {
            error(response);
          }
        }
      } else if (!response || !response["success"]) {
        try_count++;
        if (try_count <= retry_limit) {
          setTimeout(function () {
            fn_api_request(
              controller,
              action,
              params,
              success,
              error,
              try_count,
              retry_limit
            );
          }, 5000);
        } else {
          // do retry
          if (params["ignore_errors"]) {
            return;
          }

          fn_display_misc_dialog(
            '<div style="width: 400px"><center>Server error! Please email us at support@cloudHQ.net if this error persists.</center></div>',
            "ERROR"
          );
          if (error) {
            error(response);
          }
        }
        return;
      } else {
        if (success) {
          g_logged_in = true;
          success(response);
        }
        return;
      }
    },
    error: function (response, t, x) {
      try_count++;
      if (try_count <= retry_limit) {
        setTimeout(function () {
          fn_api_request(
            controller,
            action,
            params,
            success,
            error,
            try_count,
            retry_limit
          );
        }, 2000);
      } else {
        if (params["ignore_errors"]) {
          return;
        }

        g_fatal_error_flag = true;
        fn_close_misc_dialog();
        fn_display_misc_dialog(
          '<div style="width: 400px"><center>Server error! Please email us at support@cloudHQ.net if this error persists.</center></div>',
          "ERROR"
        );
        if (error) {
          error(response);
        }
      }
    },
  });
}

