//get text from html details in original content
function fn_get_plain_text_from_email_original_content_of_html(content) {
  var text = "";
  var html_txt;
  if (content.match(/<body/)) {
    html_txt = content
      .substring(content.indexOf("<body"), content.lastIndexOf("</body>"))
      .trim();
    html_txt = html_txt + "</body>";
  } else {
    html_txt = "<body>" + content + "</body>";
  }

  var outer = $("<outer></outer>");
  outer.html(html_txt);
  outer.find("img").remove();

  var element = outer.get(0);
  text = element.innerText || element.textContent;

  return text.trim();
}

// used https://github.com/nodemailer/mailparser to parse source html to text
function fn_get_plain_text_from_email_original_content(content, callback) {
  var sep = window.simple_email_parser(content);
  sep.then(
    function (result) {
      var text = "";
      if (result.text && result.text.trim() !== "") {
        text = result.text.trim();
      } else if (result.html) {
        text = fn_get_plain_text_from_email_original_content_of_html(
          result.html
        );
      }

      //sometimes it still keeps the html tags, remove those tags
      text = fn_remove_html_tags(text);

      if (callback) {
        // TODO: parse html and remove all tracking images
        var html = result.html ? result.html : result.textAsHtml;

        callback({ status: "success", text: text, html: html });
      } else {
        return text;
      }
    },
    function (err) {
      if (callback) {
        callback({ status: "error" });
      }
    }
  );
}

//remove html tags from text
function fn_remove_html_tags(html) {
  var div = document.createElement("div");
  div.innerHTML = html;
  var text = div.textContent || div.innerText || "";
  return text.trim();
}

function fn_increase_ajax_counter() {
  g_ajax_request_counter = g_ajax_request_counter + 1;
}

function fn_decrease_ajax_counter() {
  g_ajax_request_counter--;
  if (g_ajax_request_counter < 0) {
    g_ajax_request_counter = 0;
  }
}

/*
 * Reset counter after 1 second, when all ajax request has been done of setting
 * @type type
 */
var g_settimeout_for_ajax_counter_reset = null;
function fn_reset_ajax_counter() {
  if (!g_settimeout_for_ajax_counter_reset) {
    g_settimeout_for_ajax_counter_reset = setTimeout(function () {
      g_ajax_request_counter = 0;
      try {
        if (g_settimeout_for_ajax_counter_reset) {
          clearTimeout(g_settimeout_for_ajax_counter_reset);
        }

        g_settimeout_for_ajax_counter_reset = null;
      } catch (ex) {
        g_settimeout_for_ajax_counter_reset = null;
      }
    }, 1000);
  }
}

/*
 * Removes tracking images from html
 * @param {string} html
 * @return {string} html
 */
function fn_clean_tracker_images(html) {
  var outer = $("<outer></other>");
  outer.html(html);
  try {
    var images = outer.find("img");
    $.each(images, function (k, img) {
      if (img) {
        var img_src = $(img).attr("src");
        if (img_src && fn_check_for_black_list(img_src)) {
          console.log("fn_clean_tracker_images: remove img_src=", img_src);
          $(img).attr(
            "src",
            "data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7"
          );
        }
      }
    });
  } catch (ex) {
    console.log("fn_clean_tracker_images: error e=", ex);
  }
  return outer.html();
}

/**
 * Check if image url is blacklisted
 * @param {string} url - google proxy url
 * @return {boolean} blacklisted - true if url is blacklisted or false
 */
function fn_check_for_black_list(url) {
  var blacklisted = false;
  var imgurl = url.toLowerCase();
  if (imgurl !== "") {
    blacklisted = fn_check_in_known_websites(imgurl);
    //if we are unable to find tracking url in known websites, try with know string parameters
    if (blacklisted === false) {
      blacklisted = fn_check_in_known_string_params(imgurl);
    }
  }
  return blacklisted;
}

/**
 * Check for blacklisted urls in known websites
 * @param {string} imgurl - image url
 * @return {boolean} blacklisted - true if url is blacklisted or false
 */
function fn_check_in_known_websites(imgurl) {
  var blacklisted = false;
  for (var key in g_black_listed_websites) {
    for (var i = 0; i < g_black_listed_websites[key].length; i++) {
      if (imgurl.indexOf(g_black_listed_websites[key][i]) > -1) {
        blacklisted = true;
        break;
      }
    }
    if (blacklisted === true) {
      break;
    }
  }
  return blacklisted;
}

/**
 * Check for blacklisted parameters in known strings
 * @param {string} imgurl - image url
 * @return {boolean} blacklisted - true if url is blacklisted or false
 */
function fn_check_in_known_string_params(imgurl) {
  var blacklisted = false;
  for (var i = 0; i < g_black_listed_string_params.length; i++) {
    if (imgurl.indexOf(g_black_listed_string_params[i]) > -1) {
      blacklisted = true;
      break;
    }
  }

  return blacklisted;
}

