function fn_refresh_all_gmail_multiline_message_preview() {
  try {
    var tr_row = null;
    var thread_id = null;
    var count = 0;
    var list_route_view = g_sdk.Router.getCurrentRouteView();
    console.log("fn_refresh_all_gmail_multiline_message_preview: ENTERING");

    if (list_route_view && list_route_view.getRouteType() == "LIST") {
      // find all tr_rows and process them
      var tr_row_list = $("[data-legacy-thread-id]").closest("tr.zA:visible");
      var thread_id_list = [];

      if (tr_row_list.length == 0) {
        tr_row_list = $("tr[data-inboxsdk-threadid]:visible");
      }

      for (var tr_row_no = 0; tr_row_no < tr_row_list.length; tr_row_no++) {
        tr_row = tr_row_list.eq(tr_row_no);

        if (g_is_conversation_view_disabled) {
          thread_id = tr_row
            .find("[data-legacy-last-message-id]")
            .attr("data-legacy-last-message-id");
        } else {
          thread_id = tr_row
            .find("[data-legacy-thread-id]")
            .attr("data-legacy-thread-id");
        }

        if (!thread_id) {
          thread_id = tr_row.attr("data-inboxsdk-threadid");
        }
        if (thread_id) {
          thread_view = g_thread_view_cache[thread_id];
          if (thread_view && !thread_view.destroyed) {
            count = count + 1;
            fn_add_gmail_multiline_message_preview_to_row(
              thread_id,
              thread_view
            );
          }
        }
      }
    }
    console.log(
      "fn_refresh_all_gmail_multiline_message_preview: EXITING count=",
      count
    );
  } catch (e) {
    console.log("fn_refresh_all_gmail_multiline_message_preview: e=", e);
  }
}

function fn_refresh_all_gmail_preview_hover(is_retry = null) {
  try {
    var tr_row = null;
    var thread_id = null;

    var list_route_view = g_sdk.Router.getCurrentRouteView();
    var count = 0;
    var candidate_count = 0;
    console.log("fn_refresh_all_gmail_preview_hover: ENTERING");

    if (list_route_view && list_route_view.getRouteType() == "LIST") {
      // find all tr_rows and process them
      var tr_row_list = $("[data-legacy-thread-id]").closest("tr.zA:visible");
      var thread_id_list = [];

      if (tr_row_list.length == 0) {
        tr_row_list = $("tr[data-inboxsdk-threadid]:visible");
      }

      for (var tr_row_no = 0; tr_row_no < tr_row_list.length; tr_row_no++) {
        candidate_count = candidate_count + 1;
        tr_row = tr_row_list.eq(tr_row_no);
        thread_id = fn_get_thread_id_using_current_element(tr_row);

        if (thread_id) {
          thread_view = g_thread_view_cache[thread_id];
          if (thread_view && !thread_view.destroyed) {
            count = count + 1;
            fn_add_gmail_preview_hover_to_row(thread_id, thread_view);
          }
        }
      }
    }

    if (count == 0 && candidate_count > 0 && !is_retry) {
      // start one more in 10 secons
      setTimeout(function () {
        fn_refresh_all_gmail_preview_hover(true);
      }, 5000);
    }
    console.log(
      "fn_refresh_all_gmail_preview_hover: EXITING count=",
      count,
      " candidate_count=",
      candidate_count
    );
  } catch (e) {
    console.log("fn_refresh_all_gmail_preview_hover: e=", e);
  }
}

